def new_session_id() -> str:
    return secrets.token_urlsafe(24)

def current_user(request: Request) -> Optional[Dict[str, Any]]:
    sid = request.cookies.get(SESSION_COOKIE)
    if not sid:
        return None
    return SESSIONS.get(sid)

