@app.post("/api/v1/users/login/")
async def users_login(request: Request) -> Response:
    payload = {}
    try:
        payload = await request.json()
    except Exception:
        payload = {}

    username = payload.get("username") or "demo"
    must_change = bool(payload.get("newPassword")) and False  # keep false in mock

    sid = new_session_id()
    user = {
        "username": username,
        "roles": ["owner"],
        "permissions": ["*"],
        "displayName": username,
    }
    SESSIONS[sid] = user

    resp = JSONResponse({
        "mustChangePassword": must_change,
        "user": user,
    })
    resp.set_cookie(
        SESSION_COOKIE,
        sid,
        httponly=True,
        samesite="lax",
    )
    return resp

@app.get("/api/v1/users/user/")
def users_user(request: Request):
    user = current_user(request)
    if not user:
        # Some SPAs handle unauth as 403; keeping 401 explicit.
        raise HTTPException(status_code=401, detail="Not authenticated")
    return user

