def register_json_route(method: str, path: str):
    async def handler(request: Request, **kwargs):
        key = (method.upper(), path)
        if key in JSON_EXAMPLES_TUP:
            return JSON_EXAMPLES_TUP[key]
        # Basic stub that still helps the frontend continue.
        stub = {
            "ok": True,
            "method": method.upper(),
            "path": path,
            "params": kwargs,
        }
        # echo minimal request body if present
        try:
            body = await request.json()
            stub["request"] = body
        except Exception:
            pass
        return stub

    app.add_api_route(
        path,
        handler,
        methods=[method.upper()],
        name=f"mock_patch_api_v1_orders_notification-template_1_preview",
    )

